import list from '@/mixins/list'

export default {
	name: 'TableModal',
	mixins: [list],
	props: {
		drawer: {
			type: Boolean,
			default: () => false
		},
		detailData: {
			type: Object,
			default: () => {}
		},
		currency: {
			type: Array,
			default: function() {
				return []
			}
		}
	},
	data() {
		return {
			elDrawer: true
		}
	},
	watch: {
		drawer: {
			handler(val) {
				this.elDrawer = val
			},
			immediate: true
		}
	},
	methods: {
		handlePaginationChange(val, type) {
			this.$emit(
				'checkDetail',
				{},
				{
					pageSize: type === 1 ? val : this.pageSize,
					pageIndex: type === 2 ? val : this.pageIndex,
					searchAgentId: this.detailData.currentAgentId
				}
			)
		},
		handleClose() {
			this.$emit('update:drawer', false)
		}
	}
}
